import React from "react";

const Header = () => (
  <header className="fixed w-full top-0 bg-bg-secondary/80 backdrop-blur-sm z-50">
    <nav className="container mx-auto flex justify-between items-center py-6 px-8">
      <span className="text-3xl font-bold text-text-primary">SARXNNN._</span>
      <ul className="flex gap-12 text-text-primary/90">
        <li><a href="#home" className="hover:text-accent">Home</a></li>
        <li><a href="#about" className="hover:text-accent">About</a></li>
        <li><a href="#lab" className="hover:text-accent">Lab</a></li>
      </ul>
    </nav>
  </header>
);

export default Header;
